/* eslint-disable jsx-a11y/alt-text */
import { useState, useEffect } from "react";
import "./App.css";
function App() {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch("http://localhost:8000/data")
      .then((res) => {
        return res.json();
      })
      .then((db) => {
        setData(db.advisorProfileCollection.items);
      });
  }, []);
  console.log(data);
  return <>{data && data.map((item, index) => <li key={index}>{item.categoriesCollection.items[0].avatarUrl}</li>)}</>;
}

export default App;
